nx.graphic.DragManager.description:
Global drag manager

    var Component = nx.define(nx.ui.Component, {
       view: {
           content: {
               name: "stage",
               type: 'nx.graphic.TopologyStage',
               props: {
                   width: 600,
                   height: 600
               },
               content: {
                   name: 'a',
                   type: 'nx.graphic.Rect',
                   props: {
                       x: 100,
                       y: 10,
                       width: 100,
                       height: 100,
                       fill: '#f0f'
                   },
                   events: {
                       'mousedown': '{#_mousedown}',
                       'dragmove': '{#_dragmove}'
                   }
               }
           }
       },
       properties: {
           positionX: {
               value: 150
           }
       },
       methods: {
           _mousedown: function (sender, event) {
               event.captureDrag(sender.owner());
           },
           _dragmove: function (sender, event) {
               sender.set("x", sender.get("x") * 1 + event.drag.delta[0]);
               sender.set("y", sender.get("y") * 1 + event.drag.delta[1]);
           }

       }
    });


    var app = new nx.ui.Application();
    var comp = new Component();
    comp.attach(app);

